    DataUsage: "boolean",
    Downtime: "boolean"
};

Script.Outputs = {
    Done: "signal"
};


// When toggle is pressed, filterVar noodl variable will update and then pass signal to this script to run function that updates sessionStorage filter.
Script.Signals.Run = function() {
    var filter = {"site_id": true,
    "common_name": Script.Inputs.Description,
    "availability": Script.Inputs.Availability,
    "v_availability": Script.Inputs.VSATAvailability,
    "c_availability": Script.Inputs.CellAvailability,
    "v_sla_pass_mean": Script.Inputs.VSATQoSPassed,
    "c_sla_pass_mean": Script.Inputs.CellQoSPassed,
    "a_sla_pass_mean": Script.Inputs.AuxQoSPassed,
    "v_latency_mean": Script.Inputs.VSATLatency,
     "c_latency_mean": Script.Inputs.CellLatency,
    "a_latency_mean": Script.Inputs.AuxLatency,
    "v_jitter_mean": Script.Inputs.VSATJitter,
    "c_jitter_mean": Script.Inputs.CellJitter,
    "a_jitter_mean": Script.Inputs.AuxJitter,
    "sw_ev_ct": Script.Inputs.SwitchingEvents,
     "ttl_trf_ct_mb": Script.Inputs.DataUsage,
    "unknown": Script.Inputs.Downtime};
    
    sessionStorage.setItem('filter', JSON.stringify(filter))
    Script.Outputs.Done();

    };
